import logo from '../logo.svg';
import {api} from "../API/api";

function PruebaComponent() {

    const [logged, setLogged] = useState({});

    useEffect(() => {
      async function loggedIn(){
          getLogged();
      }
      loggedIn()
    }, [])

    const getLogged = async () => {
        await api.isLogged()
            .then(response => {
                console.log(response.data);
                setLogged(response.data)
            })

    }
    
    return (
        <div className="App">
